const Menu = () => {
  return (
    <nav className="navbar">
      <div className="nav-item">Stay</div>
      <div className="nav-item">Flight</div>
      <div className="nav-item">Car Rentals</div>
      <div className="nav-item">Attractions</div>
      <div className="nav-item">Airport taxis</div>
    </nav>
  );
};

export default Menu;
